import circles from './assets/Circles.svg';
import logo from './assets/logo.svg';
import Typical from 'react-typical';
import React from 'react';
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo "/>
        <img src={circles} className="App-circles" alt="circles"/> 
          <Typical
          className="App-circles-text-h1"
          steps={[' Young.', 2000, ' Belgian.', 2000, ' Web-designer.', 2000, ' Freelancer.', 2000, ' Self-learner.', 2000]}
          loop={Infinity}
          wrapper="h1"
          />
        <h3 className="App-circles-text-h3">Lo√Øc Verhaeghe</h3>
      </header>
      <button className="App-button">scroll</button>
        <nav className="nav" id="navbar">
        <div className="nav-content">
          <img
            src={logo}
            className="nav-logo"
            alt="Logo."
            onClick={this.scrollToTop}
          />
          <ul className="nav-items">
            <li className="nav-item">Section 1</li>
            <li className="nav-item">Section 2</li>
            <li className="nav-item">Section 3</li>
            <li className="nav-item">Section 4</li>
            <li className="nav-item">Section 5</li>
          </ul>
        </div>
      </nav>
      <footer>  
      </footer>
    </div>
    );
}

export default App;
